import React from 'react';
import Card from './Card';

const CardList = ({ Robots }) => {

    const cardCompenent = Robots.map((user, i) => {
        return <Card 
        key={i} 
        id={Robots[i].id} 
        name={Robots[i].name} 
        email={Robots[i].email} />
    })

    return (
    <div>
        {cardCompenent}
    </div>
    );
}

export default CardList;
